import styled from "styled-components";

export const CounterStyle = styled.div`
  b {
    background-color: #f46a6a;
    color: #fff;
    max-width: 800px;
    margin: 100px auto 0;
    text-align: center;
    display: table;
  }

  .counter {
    display: table-cell;
    margin: 1.5%;
    font-size: 50px;
    background-color: #ff6f6f;
    width: 200px;
    border-radius: 50%;
    height: 200px;
    vertical-align: middle;
  }
`;
